import "./App.css";
import Carousel from "./Carousel.js";
import Navbar from "./Navbar.js";
function App() {
  return (
    <div className="App">
      <div className="navbar">
        <Navbar />
        <div className="home">
          <Carousel />
        </div>
      </div>
    </div>
  );
}

export default App;
